const express = require("express");
const app = express();

app.get("/distance/:from/:to", (req, res) => {
  distances.forEach((country) => {
    if (country.FIELD1.toLowerCase() == req.params.from) {
      res.send(country[req.params.to.toUpperCase()]);
    }
  });
});
app.get("/countries/:c", (req, res) => {
  const arr = [];
  countries.forEach((e) => {
    if (e.toLowerCase().includes(req.params.c)) {
      arr.push(e);
    }
  });
  res.json({ countries: arr });
});
app.get("/verifyCountry/:c", (req, res) => {
  // const arr = [];
  countries.forEach((e) => {
    if (e.toLowerCase() == req.params.c) {
      res.send(true);
    }
  });
});
app.listen(process.env.PORT || 3000, () => {
  console.log("Server Started");
});
